import React from "react";

import Cards from "./cards";
import CollapsePage from "./readmore";

const CardsList = ({ results }) => {
  return (
    <div className="style">
      {results.map((result) => (
        <Cards key={result.id} result={result} />
      ))}
    </div>
    /*  <Card style={{ width: "18rem" }}>
        <Card.Img
          variant="top"
          src={`http://image.tmdb.org/t/p/w185/` + props.img}
        />
        <Card.Title></Card.Title>
        <CollapsePage overview={props.overview} />
      </Card> */
  );
};
export default CardsList;
